# HEAVEN BARNESimport randomnum=random.randint(1, 100)#print(num)players_guess=int(input("Hello,welcome to the game.We are trying to find a number between 1 to 100,why don't you give it a go. Enter a number: "))while players_guess != num:    if players_guess < num:        print("You are too low")    if players_guess > num:        print("You are way too high")    players_guess=int(input("Enter a number: "))print("Congrulations!")